INSERT INTO `products` (`id`, `restaurant_id`, `name`, `description`, `flavor`, `image_url`, `thumbnail_url`, `price`, `discount`, `created`, `modified`) VALUES
(1, 1, '混合牛肉粉', '河粉是一种盛行在东亚和东南亚的美食。面条种类为米粉和鸡蛋面。混合牛肉粉(Mixed Beef Noodle Soup)为河粉的一种。', '原味', 'http://45.55.164.174/eat/img/hunheniuroufen.jpg', 'http://45.55.164.174/eat/img/hunheniuroufen256.jpg', 10.62, 0, NULL, NULL),
(2, 1, '虾和鸡肉粉丝', 'Vermicelli为一种传统的意大利式面条。一种细长,圆柱形的面食。虾和鸡肉粉丝(Shrimp & Chicken Vermicelli)为Vermicelli的一种。', '原味', 'http://45.55.164.174/eat/img/xiahejiroufensi.jpg', 'http://45.55.164.174/eat/img/xiahejiroufensi256.jpg', 11.5, 0, NULL, NULL),
(3, 1, '生牛肉粉', '河粉是一种盛行在东亚和东南亚的美食。面条种类为米粉和鸡蛋面。生牛肉粉(Rare Beef Noodle Soup)为河粉的一种。', '原味', 'http://45.55.164.174/eat/img/shengniuroufen.jpg', 'http://45.55.164.174/eat/img/shengniuroufen256.jpg', 10.62, 0, NULL, NULL),
(4, 1, '馄饨和叉烧肉粉', '河粉是一种盛行在东亚和东南亚的美食。面条种类为米粉和鸡蛋面。馄饨和叉烧肉粉(Wonton & BBQ Pork Noodle Soup)为河粉的一种。', '其他', 'http://45.55.164.174/eat/img/hundunhechashaoroufen.jpg', 'http://45.55.164.174/eat/img/hundunhechashouroufen256.jpg', 10.62, 0, NULL, NULL),
(5, 1, '牛肉和猪肉粉丝', 'Vermicelli为一种传统的意大利式面条。一种细长,圆柱形的面食。牛肉和猪肉粉丝(Beef & Pork Vermicelli)为Vermicelli的一种', '其他', 'http://45.55.164.174/eat/img/niurouhezhuroufensi.jpg', 'http://45.55.164.174/eat/img/niurouhezhuroufensi256.jpg', 11.5, 0, NULL, NULL),
(6, 2, '豚骨酱油拉面', 'Tonkotsu Ramen Shoyu - 一种日本特色拉面。不同口味的汤底，加上不同种类配菜，有海苔，玉米和猪肉等。', '咸香', 'http://45.55.164.174/eat/img/tungujiangyoulamian.jpg', 'http://45.55.164.174/eat/img/tungujiangyoulamian256.jpg', 11.5, 0, NULL, NULL),
(7, 2, '豚骨味噌拉面', 'Tonkotsu Ramen Miso - 一种日本特色拉面。不同口味的汤底，加上不同种类配菜，有海苔，玉米和猪肉等。', '咸鲜', 'http://45.55.164.174/eat/img/tunguweizenglamian.jpg', 'http://45.55.164.174/eat/img/tunguweizenglamian256.jpg', 11.5, 0, NULL, NULL),
