(16, 10, '豉油皇炒面', 'Stir fry egg noodle with veggie － 豉油皇炒面是一道具有广东特色的著名汉族小吃，它是广州人喝早茶最爱点的小吃，也是普通人家餐桌上的家常早餐。烹调时，先将韭菜、鱿鱼、洋葱、绿豆芽等辅料炒熟调味，倒入面条拌炒的同时，加入生抽和老抽给其上色，才可让豉油皇炒面酱香四溢，色泽黝黑明亮，面条爽滑弹牙。', '葱香', 'http://45.55.164.174/eat/img/chiyouhuangchaomian.jpg', 'http://45.55.164.174/eat/img/chuyouhuangchaomian256.jpg', 7.96, 0, NULL, NULL),
