(45, 10, '蜀味口水鸡', 'Steamed chicken with chili sauce - 口水鸡是中国四川及重庆地区汉族特色菜肴，属于川菜系中的凉菜，佐料丰富，集麻辣鲜香嫩爽于一身。 在烹制时，煮鸡用的汤料很有讲究，需要恰到好处，这样可以最大限度地保存鸡的可溶性蛋白，增加鸡肉的鲜美程度，又能具备其特有的香型和滋味。', '清凉爽滑', 'http://45.55.164.174/eat/img/koushuiji.jpg', 'http://45.55.164.174/eat/img/koushuiji256.jpg', 7.08, 0, NULL, NULL),
(46, 10, '蜀味辣子鸡', 'Peppery chicken - 辣子鸡，是一道大众喜闻乐见的美味佳肴，一般以鸡为主料，加上葱、干辣椒、花椒、盐、胡椒、味精等多种材料精制而成', '麻辣', 'http://45.55.164.174/eat/img/shanchenglaziji.jpg', 'http://45.55.164.174/eat/img/shanchenglaziji256.jpg', 13.27, 0, NULL, NULL),
(47, 10, '蜀味烧茄子', 'Braised eggplant - 烧茄子是一道汉族名菜，属于浙菜系或东北菜。咸鲜回甜、酱香浓郁。以茄子为主要食材的家常菜，营养价值丰富，味道咸鲜，容易上手。以茄子、植物油、甜面酱、白糖、酱油、精盐、味精、水淀粉、葱、姜、蒜等制作而成', '咸鲜', 'http://45.55.164.174/eat/img/hongshaoqiezi.jpg', 'http://45.55.164.174/eat/img/hongshaoqiezi256.jpg', 10.62, 0, NULL, NULL),
(48, 10, '蜀味烤鱼', 'Special Roast Fish - 烤鱼是指鱼类经过烤制之后然后进行烹饪的一种方法，这种烹调方式实现了“一烤二炖”。是烤鱼界的一次新变革。现在提到“烤鱼”大多指“川味烤鱼”。', '鲜美', 'http://45.55.164.174/eat/img/kaoyu.jpg', 'http://45.55.164.174/eat/img/kaoyu256.jpg', 40.7, 0, NULL, NULL),
(49, 10, '地三鲜', '东北地三鲜，是一道采用红烧的家常菜。此菜色泽油亮、鲜美爽口，具有止血调、健脾开胃等功效。', '鲜美', 'http://45.55.164.174/eat/img/disanxian1024.jpg', 'http://45.55.164.174/eat/img/disanxian256.jpg', 10.62, 0, NULL, NULL),
(50, 10, '红油抄手', 'Wonton with hot sesame sauce － 红油抄手是四川著名的汉族小吃。此种小吃柔嫩鲜美，汤汁微辣浓香。抄手是四川人对馄饨的称呼，馄饨在全国各地均有制作，红油抄手是最为著名的品种之一。', '香辣', 'http://45.55.164.174/eat/img/hongyouchaoshou1024.jpg', 'http://45.55.164.174/eat/img/hongyouchaoshou256.jpg', 6.19, 0, NULL, NULL),
