INSERT INTO `restaurants` (`id`, `name`, `address`, `postal_code`, `telephone`, `email`, `description`, `desc_short`, `type`, `image_url`, `image_url_small`, `created`, `modified`) VALUES
(1, 'Tao Asian Kitchen', '280 Elgin St, Ottawa', 'K2P 1M2', '+1 (613) 695-1300', 'example@yahoo.ca', 'Tao Asian Kitchen是一家颇具特色的餐馆，这里有点心，牛肉米粉！味道好不好，尝尝就知道！如果你十分喜爱中餐或者越南餐，快来下单品尝吧！', '味道好不好，尝尝就知道！如果你十分喜爱中餐或者越南餐，快来下单品尝吧！', '中餐/越南餐', 'http://45.55.164.174/eat/img/tao2.jpg', 'http://45.55.164.174/eat/img/tao1.jpg', NULL, NULL),
(2, '银座 GINZA', '280 Elgin Ottawa', 'K2P 1M2', '+1 (613) 233-2888', 'example.alirang@yahoo.ca', '以特色拉面为主打，不但推出了口味各异的十余种拉面汤，还提供生鱼片、寿司以及日本居酒屋典型的下酒菜等等。欢迎大家下单品尝！', '以特色拉面为主打，还提供生鱼片、寿司以及日本居酒屋典型的下酒菜等等。', '日餐', 'http://45.55.164.174/eat/img/ginza2.jpg', 'http://45.55.164.174/eat/img/ginza1.jpg', NULL, NULL),
(10, '蜀味烤鱼', '706 Somerset St W, Ottawa', 'K1R 6P6', '+1 (613) 695-6668', 'example@yahoo.ca', '传承巴蜀地区经典烤鱼做法，用料讲究，菜品丰富，浓郁醇香，口味正宗，营养美味。是您在渥太华能品尝到的正宗川味。', '传承巴蜀地区经典烤鱼做法，用料讲究，是您在渥太华品尝到的正宗川味。', '川菜/湘菜/粤菜', 'http://45.55.164.174/eat/img/shuwei2.png', 'http://45.55.164.174/eat/img/shuwei1.png', NULL, NULL),
(11, '三合酒家', '769 Gladstone Ave. Ottawa', 'K1R 6X4', '+1 (613) 762-7219', 'example.alirang@yahoo.ca', '服务渥太华留学生近八年三合酒家，以其美味、平价、快捷、方便的经营理念赢得了广大顾客的喜爱和支持。不论堂食或者外卖，您都能从每道菜中品尝到我们的用心，几年如一日走来，“吃好菜，到三合”已经深入大家内心。', '服务渥太华留学生近八年，“吃好菜，到三合”已经深入大家内心。', '中餐', 'http://45.55.164.174/eat/img/sanhe2.jpg', 'http://45.55.164.174/eat/img/sanhe1.jpg', NULL, NULL),
(12, '陈氏河粉', '1519 Merivale Rd, Ottawa, ON', 'K2G 3K2', '+1 (613) 226-8812', 'example.alirang@yahoo.ca', '陈氏河粉拥有舒适的环境，精美的装修。提供各种各样的越南米粉、各种海鲜烧烤， 油炸小吃品种等等。餐厅很干净整洁，业主为客户提供开放式厨房,承诺提供最健康和最美味的食物。', '业主为客户提供开放式厨房,承诺提供最健康和最美味的食物。', '中餐', 'http://45.55.164.174/eat/img/chenshihefen2.jpg', 'http://45.55.164.174/eat/img/chenshihefen1.jpg', NULL, NULL),
(13, '聚香园', '641 Somerset St W, Ottawa, ON K1R 5K1', 'K1R 5K1', '+1 (613) 321-3669', 'example.alirang@yahoo.ca', '正宗北方风味的小餐馆。聚香圆主打正宗北方风味炭火烧烤，传统风味，吃出家乡感觉。羊肉串，鸡肫，等等等等应有尽有。', '聚香圆主打正宗北方风味炭火烧烤，传统风味，吃出家乡感觉。', '中餐', 'http://45.55.164.174/eat/img/juxiangyuan2.jpg', 'http://45.55.164.174/eat/img/juxiangyuan1.jpg', NULL, NULL);
